import logo from './logo.svg';
import './App.css';
import React,{Component} from 'react' 
import Users from './Users'
import Todos from './Todos'

class App extends Component
{
  constructor()
  {
    super()
  }

  render()
  {
    return(
      <div className = "App">
        <Users/>
        <Todos/>
      </div>
    )
  }
}

export default App;
